% PP方法计算平衡态Lieb光学电导率 - MATLAB版本
clear;
tic;
% 参数设置
L = 100;          % 原子数
delta = 0.1; %[control:editfield:46ce]{"position":[9,12]}
Jdelta = 10;
J = Jdelta / delta;
J_plus = J*(1 + delta);
J_minus = J*(1 - delta);
N_Lieb_site = 3;
epsilon_Central = 0 * ones(1,N_Lieb_site);
eta = 1e-2;      % 展宽因子
A_freq = 0;
Disorder = 2;

rng(1);
% 若为零频，则矢势在跳变后不再变化，直接用同一个幺正算符演化节省计算
if isapprox(A_freq,0,'tight')
    Flag_Step = true;
else
    Flag_Step = false;
end



warning on
SelectState =150; %[control:editfield:9018]{"position":[14,17]}
% 时间参数
Fs = 1;            % Sampling frequency
dt = 1/Fs;             % Sampling period
t_steps = 30000;             % Length of signal
t = (0:t_steps-1) * dt;        % Time vector
t_max = (t_steps-1) * dt;

% 探针脉冲参数
A_t = (1.0e-2) * cos(2 * pi * A_freq * t); % 阶跃型矢量势幅度
t_probe = 0.0;    % 探针施加时间
A_t(t < t_probe) = 0;


%% 主程序开始
fprintf('开始计算...\n'); %[output:6d4f25eb]



% If no disorder
% 初始化系统
[H0_clean, H_00, H_01] = build_H0(epsilon_Central, L, J_minus, J_plus, 0);
[eigvecs, eigvals] = eig(H0_clean);
eigvals = diag(eigvals);
figure %[output:1da48768]
plot(eigvals,'.','MarkerSize',10); %[output:1da48768]

hold on %[output:1da48768]
title('Eigenvalue') %[output:1da48768]
plot(SelectState, eigvals(SelectState),'+','MarkerSize',10,'LineWidth',3); %[output:1da48768]
set(gca,'fontsize',14) %[output:1da48768]
set(gca,'LineWidth',1) %[output:1da48768]
psi = eigvecs(:, SelectState);  % 基态
figure %[output:0ad7ff92]
plot(psi) %[output:0ad7ff92]
%%

% 有探针的时间演化
psi_probe = psi;
j_total = zeros(1, t_steps);

% 阶跃型矢量势在跳变后随时间不变，只需计算一次演化算符
H_A = build_H_with_A(L, A_t(find(A_t,1)), H_00, H_01, zeros(1,N_Lieb_site*L));
U = expm(-1i * H_A * dt);

for ii = 1:t_steps
    t_current = t(ii);

    % 施加阶跃型矢量势
    A_now = A_t(ii);

    % 含Peierls相位的哈密顿量
    if Flag_Step
        psi_probe = U * psi_probe;
    else
        H_A = build_H_with_A(L, A_now, H_00, H_01, Dis_Diag);
        psi_probe = time_evolve(psi_probe, H_A, dt);
    end

    % 计算电流期望值
    J_op = build_current_operator(L, H_01, A_now);
    j_total(ii) = psi_probe' * J_op * psi_probe;
end

% 计算探针引起的电流
j_probe = j_total;

% 傅里叶变换得到频率空间电流
window = exp(-eta * t);  % 指数衰减窗函数
j_probe_windowed = j_probe .* window;

j_probe_fft = fft(j_probe_windowed);

% 只取正频率部分
% refered to the help file in fft
positive_freqs = Fs/t_steps * (0:(t_steps/2));
j_probe_fft = j_probe_fft/t_steps;
j_probe_fft = j_probe_fft(1:t_steps/2+1);
j_probe_fft(2:end-1) = 2 * j_probe_fft(2:end-1);
% 计算矢量势的傅里叶变换
A_t_windowed = A_t .* window;
A_t_fft = fft(A_t_windowed)/t_steps;
A_probe_fft = A_t_fft(1:t_steps/2+1);
A_probe_fft(2:end-1) = 2 * A_probe_fft(2:end-1);

% 计算光学电导率
sigma_pp = j_probe_fft ./ (1i * (positive_freqs + 1i * eta) .* A_probe_fft);


sigma_nodisorder = abs(real(sigma_pp));



%%
% If disorder
% 初始化系统

Dis_Diag = Disorder * repelem((rand(1, L)-0.5),3);
% [eigvecs, eigvals] = eig(H0_clean);
% eigvals = diag(eigvals);
% psi = eigvecs(:, SelectState);  % 基态

% 有探针的时间演化
psi_probe = psi;
j_total = zeros(1, t_steps);
% 阶跃型矢量势在跳变后随时间不变，只需计算一次演化算符
H_A = build_H_with_A(L, A_t(find(A_t,1)), H_00, H_01, Dis_Diag);
U = expm(-1i * H_A * dt);
for ii = 1:t_steps
    t_current = t(ii);

    % 施加阶跃型矢量势
    A_now = A_t(ii);

    % 含Peierls相位的哈密顿量
    if Flag_Step
        psi_probe = U * psi_probe;
    else
        H_A = build_H_with_A(L, A_now, H_00, H_01, Dis_Diag);
        psi_probe = time_evolve(psi_probe, H_A, dt);
    end

    % 计算电流期望值
    J_op = build_current_operator(L, H_01, A_now);
    j_total(ii) = psi_probe' * J_op * psi_probe;
end

% 计算探针引起的电流
j_probe = j_total;

% 傅里叶变换得到频率空间电流
window = exp(-eta * t);  % 指数衰减窗函数
j_probe_windowed = j_probe .* window;

j_probe_fft = fft(j_probe_windowed);

j_probe_fft = j_probe_fft/t_steps;
j_probe_fft = j_probe_fft(1:t_steps/2+1);
j_probe_fft(2:end-1) = 2 * j_probe_fft(2:end-1);

% 计算光学电导率
sigma_pp = j_probe_fft ./ (1i * (positive_freqs + 1i * eta) .* A_probe_fft);


sigma_disorder = abs(real(sigma_pp));

%%

figure %[output:319cf40b]
plot(positive_freqs, sigma_nodisorder, 'b-', 'LineWidth', 1.5, 'DisplayName', 'No disorder'); %[output:319cf40b]
hold on  %[output:319cf40b]
plot(positive_freqs, sigma_disorder, 'r--', 'LineWidth', 1.5, 'DisplayName', ['Disorder=',num2str(Disorder)]); %[output:319cf40b]
ylim([0,max([sigma_disorder;sigma_nodisorder],[],'all')]) %[output:319cf40b]
xlabel('\omega'); %[output:319cf40b]
ylabel('Re \sigma(\omega)'); %[output:319cf40b]
title('Optical Conductivity via optiacl probe Method'); %[output:319cf40b]
legend %[output:319cf40b]
set(gca,'fontsize',14) %[output:319cf40b]
set(gca,'LineWidth',1) %[output:319cf40b]

disp(['Number density (No disorder): ',num2str(psi'*psi)]); %[output:05491570]
disp(['Integral result (No disorder): ',num2str(trapz(positive_freqs,sigma_nodisorder))]); %[output:5ca1ab08]

disp(['Number density: ',num2str(psi'*psi)]); %[output:6685d2b4]
disp(['Integral result: ',num2str(trapz(positive_freqs,sigma_disorder))]); %[output:1f195942]


toc; %[output:225c7f96]
